import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Join Event button and click it
    await page.waitForSelector('button.btn.btn-secondary.btn-large');
    await page.click('button.btn.btn-secondary.btn-large');

    // Take screenshot after clicking Join Event
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_join_event_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_join_event_clicked.png'));

    // Wait for the event code input field and enter a code
    await page.waitForSelector('#eventCode');
    await page.fill('#eventCode', 'example_event_code');

    // Take screenshot after entering event code
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_event_code_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_event_code_entered.png'));

    // Click the Join Event button to submit the code
    await page.click('button.btn.btn-primary');

    // Wait for the page to load after joining the event
    await page.waitForLoadState('networkidle');

    // Take final screenshot after joining the event
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_event_joined.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_event_joined.png'));

    // Extract meaningful data to verify task completion
    const eventTitle = await page.textContent('.hero-title');
    const eventStatus = await page.textContent('.hero-subtitle');

    return {
      success: true,
      action: "Joined an event using the provided event code",
      extractedData: {
        eventTitle,
        eventStatus
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

